import './App.css';

function App() {
  return (
    <div>
      <div className="App">
        <div className="heroText">
          Armchair Capital is looking for great companies
        </div>
      </div>
      <nav id="tabs">
        <div class="folder-tab selected">
          <span>Time entries</span>
        </div>
        <div class="folder-tab">
          <span>Tasks Progress</span>
        </div>


      </nav>
    </div>
  );
}

export default App;
